// src/pages/Dashboard.js
import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import "../styles/Dashboard.css";

const API_URL = "http://localhost:1212/api";

const Dashboard = ({ token, userId, userRole }) => {
  const [flights, setFlights] = useState([]);
  const [wallet, setWallet] = useState(null);
  const [walletLoading, setWalletLoading] = useState(true);

  const fetchFlights = async () => {
    try {
      const res = await axios.get(`${API_URL}/flights`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setFlights(res.data);
    } catch (err) {
      console.error("Failed to fetch flights", err);
    }
  };

  const fetchWallet = async () => {
    if (!userId || userRole !== "CUSTOMER") return;

    try {
      const res = await axios.get(`${API_URL}/wallets/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setWallet(res.data);
    } catch (err) {
      console.warn("Wallet not found, attempting to create...");
      await createWallet();
    } finally {
      setWalletLoading(false);
    }
  };

  const createWallet = async () => {
    try {
      const res = await axios.post(
        `${API_URL}/wallets/create?userId=${userId}`,
        {},
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setWallet(res.data);
    } catch (err) {
      console.error("Failed to create wallet", err);
    }
  };

  const topUpWallet = async (amount) => {
    try {
      await axios.post(
        `${API_URL}/wallet/add`,
        { userId, amount },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      fetchWallet();
      alert("Wallet topped up successfully!");
    } catch (err) {
      alert("Top-up failed");
      console.error(err);
    }
  };

  const bookFlight = async (flightId) => {
    try {
      await axios.post(
        `${API_URL}/bookings`,
        { userId, flightId },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      alert("Flight booked successfully!");
    } catch (err) {
      alert("Booking failed");
    }
  };

  useEffect(() => {
    fetchFlights();
    fetchWallet();
  }, [userId, token, userRole]);

  return (
    <motion.div
      className="dashboard-container"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.6 }}
    >
      <main className="dashboard-main no-sidebar">
        <motion.h1
          initial={{ y: -30, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ duration: 0.6 }}
        >
          ‚úàÔ∏è Welcome to Your Flight Dashboard
        </motion.h1>

        {userRole === "CUSTOMER" && (
          <section className="wallet-section">
            <motion.h2
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.3 }}
            >
              üí∞ Wallet
            </motion.h2>
            {walletLoading ? (
              <p>Loading wallet...</p>
            ) : wallet ? (
              <>
                <p className="wallet-balance">Balance: ‚Çπ{wallet.balance.toLocaleString()}</p>
                <button onClick={() => topUpWallet(1000)}>Top Up ‚Çπ1000</button>
              </>
            ) : (
              <p>Wallet unavailable.</p>
            )}
          </section>
        )}

        <section className="flights-section">
          <motion.h2
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.3 }}
          >
            üìã Available Flights
          </motion.h2>

          <ul className="flight-list">
            {flights.map((flight, idx) => (
              <motion.li
                key={flight.flightId}
                initial={{ opacity: 0, y: 10 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: idx * 0.1 }}
                className="flight-card"
              >
                <div>
                  <strong>{flight.flightNumber}</strong><br />
                  {flight.source} ‚Üí {flight.destination}<br />
                  Departure: {flight.departureDate}
                </div>
                <button onClick={() => bookFlight(flight.flightId)}>Book</button>
              </motion.li>
            ))}
          </ul>
        </section>

        <div className="history-link">
          <Link to="/bookings" className="view-bookings">üìñ View Booking History</Link>
        </div>
      </main>
    </motion.div>
  );
};

export default Dashboard;
